import React, { useEffect } from 'react';

const Logout = () => {

    useEffect(() => {
        const timer = setTimeout(() => {
            console.log('hello')
        }, 5000);
        return () => clearTimeout(timer);
      }, []);

      return (
        <div>
            Logging out...
        </div>
    );

}

export default Logout
